import Paper from '@mui/material/Paper';
import Box from '@mui/material/Box';


export const ProfilePage = () => {
    return (
        <div style={{ 
            marginLeft: '25%',
        }}>
            <h1 style={{ 
                    fontFamily: 'Roboto',
                }}> Personal data
            </h1>
            <Box>
                <Paper 
                    elevation={2}
                    sx={{
                        p: 2,
                        minWidth: '300px',
                    }}
                />
            </Box>
        </div>
    )
}
